description:
Category	All Sex

Starring	Chanel Preston, Brooklyn Lee, Aaliyah Love, Brooklyn Chase, Ryan Madison

Romantic Aggression is a sexual but intense DVD that toys with the boundaries of what is socially acceptable in the act of love making. Romantic Aggression is what happens when you're so overwhelmed by the moment your whole being becomes overttaken with fierce, emotional, sexual drive. It's the moment of pure carnal lust that turns into explosive ecstasy and the act of becoming one with your partner regardless of your sexual boundaries or emotions. Watch as the feelings get so intense that the acts themselves make you re-think the meaning of romance. It will entice you to wonder if aggression is the key ingredient of experiencing true passion!


